import React, { Component } from 'react'
import { Card, CardImg, CardText, CardBody, Col,
    CardTitle, CardSubtitle, Badge, Button, Modal, ModalHeader, ModalBody, ModalFooter } from 'reactstrap';
import Register from './Register'

export default class Member extends Component {
  constructor(props) {
    super(props);
    this.state = {
      modal: false
    };

    this.toggle = this.toggle.bind(this);
  }

  toggle() {
    this.setState(prevState => ({
      modal: !prevState.modal
    }));
  }
  render() {
    return (
        <div>
        <Card class="p-2 flex-shrink-1 bd-highlight" className="text-center" 
        style={{ marginTop:'40px', width:'346px', height:'435px', borderRadius:'5px', boxShadow:'0 4px 4px 0 rgba(0, 0, 0, 0.1)  ', border:'solid 1px #d6d6d6' ,backgroundColor:'#ffffff'}}>
          <CardImg style={{backgroundColor:'d6d6d6', margin:'auto', marginTop:'20px', marginBottom:'30px', 
          width:'150px', height:'150px', borderRadius:'50%'}}  
          src="#" alt="Card image cap" />
           <CardImg style={{backgroundColor:'d6d6d6', margin:'auto', marginTop:'20px', marginBottom:'30px', 
          width:'35px', height:'35px', borderRadius:'50%'}}  
          src="#" alt="Card image cap" />
          <CardBody>
            <CardTitle style={{textAlign:'center'}}><h2 style={{color:'#2e2e2e', fontSize:'30px', height:'36px'}}>Hi, Bro</h2></CardTitle>
            <CardSubtitle style={{textAlign:'center', marginBottom:'20px', height:'22px', fontSize:'18px', color:'#8c8c8c'}}>Welcome to The GarageLife</CardSubtitle>

            <Badge

            className="float-center"
             style={{
                width:'171.4px',
                height:'40px',
                backgroundColor:'#e07e0c',

                }} 
              pill> 
              <h2 style={{ 

              width:'126px', 
              textAlign:'center',
              margin:'auto',
              fontSize:'20px',
              fontWeight:'500px',
              color:'#ffffff', 
              fontFamily:'Roboto'
             }}> <Modal  isOpen={this.state.modal} toggle={this.toggle} 
             className={this.props.className}>
               <ModalHeader style={{
         width: '675px',
         height: 'auto',
         backgroundColor: '#ffffff'

                }} toggle={this.toggle}></ModalHeader>
               <ModalBody style={{
         width: '675px',
         height: 'auto',
         backgroundColor: '#ffffff'

                }} >
                 <Register />
               </ModalBody>
               <ModalFooter style={{
         width: '675px',
         height: 'auto',
         backgroundColor: '#ffffff', textAlign:'center'

                }} >
                <h4 style={{
         backgroundColor: '#ffffff', color: '#838383'
                }} >Already have an account ?</h4> <h4 style={{
                 backgroundColor: '#ffffff', color: '#2e4ffc'
                        }}>Login</h4>
               </ModalFooter>
             </Modal></h2>
             </Badge>

            </CardBody >
            <CardBody style={{width:'346px', height:'95px',borderRadius:'5px',
          border:'solid 1px #d6d6d6', backgroundColor:'#ffffff'
          }}>
              <Col > Posts</Col>
              <Col > Followers</Col>
              <Col > Following</Col>
            </CardBody>
        </Card>
      </div>
    )
  }
}
